const PAGES = {
  HOME: 'home',
  PROFILE: 'profile',
  EDIT_PROFILE: 'edit_profile',
  SIGNIN: 'signin',
};

export default function NavigationPanel(props) {
  return (
    <nav>
      {props.isConnected ? (
        <div>
          <a
            href="#"
            onClick={() => props.setCurrentPage(PAGES.HOME)}
            className={props.currentPage === PAGES.HOME ? 'active' : ''}
