          <a
            href="#"
            onClick={() => props.setCurrentPage(PAGES.EDIT_PROFILE)}
            className={props.currentPage === PAGES.EDIT_PROFILE ? 'active' : ''}
          >
            Editer profil
          </a>
          <a href="#" onClick={props.logout}>
            DÃ©connexion
          </a>
        </div>
      ) : (
        <a
          href="#"
          onClick={() => props.setCurrentPage(PAGES.SIGNIN)}
          className={props.currentPage === PAGES.SIGNIN ? 'active' : ''}
        >
          Inscription
        </a>
      )}
    </nav>
  );
}
